import "./service.css";
const services = () => {
  return (
      <div className="bg-12-1">
        <div className="group-33885">
          <span className="home">HOME </span>
          <span className="services">SERVICES </span>
          <span className="about-us">ABOUTUS </span>
          <span className="contact"> CONTACT</span>
        </div>
        <img className="rectangle-3" src="" />
        <div className="rectangle-188">
          <span className="services-1">SERVICES</span>
          <img className="customer-1" src="https://i.pinimg.com/564x/9e/70/de/9e70de0505bf44d82dc41590161614d2.jpg"/>
        </div>
      </div>
    
  );
};
export default services;
